import React from "react";
import { connect } from "react-redux";
import * as actions from "actions";

class Content extends React.Component {
  componentDidMount() {
    console.log(this);

    this.props.getSongs(() => {
      console.log("received");
    });
  }

  render() {
    if (this.props.songs) {
      return this.props.songs.songs.map((song, i) => {
        const relax = song.relax === true ? "relax " : "";
        const exciting = song.exciting === true ? "exciting " : "";
        const positive = song.positive === true ? "positive " : "";
        const negative = song.negative === true ? "negative " : "";
        const old_but_gold = song.old_but_gold === true ? "old_but_gold " : "";
        const tags = relax + exciting + positive + negative + old_but_gold;
        return (
          <div key={i} className={tags}>
            {song.music}
          </div>
        );
      });
    }
    return <div>Loading...</div>;
  }
}
const mapStatetoProps = state => {
  return {
    songs: state.song.songs
  };
};
export default connect(
  mapStatetoProps,
  actions
)(Content);
